Use Same Syntax for MongoDB and SQL with C# or Linq<p>Noticed MongoDB has different keywords, like InsertOne, ReplaceOne , etc.
A point of Linq (Language Integrated Query), was to have a universal language where people can utilize dependency injection and swap between SQL or NoSQL without changing syntax heavily .  SQL uses .Add() and Remove() .</p>

<p>Is there an easy way to make the two have similar syntax?</p>

<p><strong>SQL:</strong></p>

<p><a href="https://learn.microsoft.com/en-us/ef/core/saving/basic" rel="nofollow noreferrer">https://learn.microsoft.com/en-us/ef/core/saving/basic</a></p>

<p><strong>MongoDB:</strong></p>

<p><a href="https://learn.microsoft.com/en-us/aspnet/core/tutorials/first-mongo-app?view=aspnetcore-2.2&amp;tabs=visual-studio" rel="nofollow noreferrer">https://learn.microsoft.com/en-us/aspnet/core/tutorials/first-mongo-app?view=aspnetcore-2.2&amp;tabs=visual-studio</a></p>

<p><a href="https://docs.mongodb.com/manual/reference/method/db.collection.insertOne/" rel="nofollow noreferrer">https://docs.mongodb.com/manual/reference/method/db.collection.insertOne/</a></p>

<pre><code>public BookService(IConfiguration config)
    {
        var client = new MongoClient(config.GetConnectionString("BookstoreDb"));
        var database = client.GetDatabase("BookstoreDb");
        _books = database.GetCollection&lt;Book&gt;("Books");
    }

    public List&lt;Book&gt; Get()
    {
        return _books.Find(book =&gt; true).ToList();
    }

    public Book Get(string id)
    {
        return _books.Find&lt;Book&gt;(book =&gt; book.Id == id).FirstOrDefault();
    }

    public Book Create(Book book)
    {
        _books.InsertOne(book);
        return book;
    }

    public void Update(string id, Book bookIn)
    {
        _books.ReplaceOne(book =&gt; book.Id == id, bookIn);
    }

    public void Remove(Book bookIn)
    {
        _books.DeleteOne(book =&gt; book.Id == bookIn.Id);
    }

    public void Remove(string id)
    {
        _books.DeleteOne(book =&gt; book.Id == id);
    }
}
</code></pre>

